import React from "react";
import '../App.css'

export default function Home() {
  return (
    <main>
      <div className="home-background">
        <section className="relative flex min-h-screen pt-12 lg:pt-24 px-12">
          <h1 className="justify-left text-6xl text-green-100 font-bold cursive leading-none lg:leading-snug home-name">
            Welcome to The Coding<br/>Netowork's official website
          </h1>
          <h2 className="justify-center">We are a small organisation and we dont have much resourses that we can use</h2>
        </section>
      </div>
    </main>
  );
}
